import React from "react";
import { Route, Redirect } from "react-router-dom";
import { auth, firebaseApp } from '../firebase';


function Protectedroute() {
    const user = firebaseApp.auth().currentUser;
    return (
        {
            if(user) {
                <Route path="/dealform">
                    <DealForm />
                </Route>
            }
        }
    )
}
export default Protectedroute
